  "text" : "\uADF8\uB807\uAE30 \uB54C\uBB38\uC5D0 \uC5B8\uB860\uACFC \uB300\uC911\uC5D0 \uC758\uD574 \uD589\uD574\uC9C0\uB294 \uBB34\uBD84\uBCC4\uD55C \uBC94\uC8C4\uC790 \uC2E0\uC0C1\uACF5\uAC1C\uB77C\uB358\uAC00, \uC5B8\uB860\uC0AC\uB4E4\uC758 \uC120\uC815\uC801\uC778 \uBC94\uC8C4 \uBCF4\uB3C4 \uD589\uD0DC\uB97C \uACBD\uACC4\uD560 \uD544\uC694\uAC00 \uC788\uB294 \uAC83\uC774\uC8E0. \uC21C\uAC04\uC801\uC778 \uD638\uAE30\uC2EC\uC774\uB77C\uB358\uAC00 \uBCF5\uC218\uC2EC \uB4F1\uC740 \uCDA9\uC871\uC2DC\uD0AC \uC218 \uC788\uC744\uC9C0 \uBAB0\uB77C\uB3C4, \uADF8\uAC8C \uC6B0\uB9AC\uC5D0\uAC8C \uC5BC\uB9C8\uB098 \uB3C4\uC6C0\uC774 \uB420\uC9C0 \uC758\uBB38\uC785\uB2C8\uB2E4.",
