  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uAD6D\uAC00\uC758 \uC9C0\uC6D0 \uC5C6\uB294 \uB300\uD559\uB4F1\uB85D\uAE08 \uB3D9\uACB0\uC774\uB098 \uC778\uD558 \uC815\uCC45\uC744 \uC369 \uBC18\uAE30\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. \uB35C \uAC77\uD78C \uB4F1\uB85D\uAE08 \uB9CC\uD07C \uBB54\uAC00\uB294 \uC904\uC5B4\uB4E4\uAE30 \uB9C8\uB828\uC774\uC8E0. \uC608\uB97C \uB4E4\uC790\uBA74 \uB3C4\uC11C\uAD00 \uB4F1\uC758 \uB3C4\uC11C\uAD6C\uC785\uBE44\uB77C\uB358\uAC00, \uC7A5\uD559\uAE08 \uC9C0\uAE09 \uB4F1\uC758 \uD559\uC0DD\uBCF5\uC9C0\uC815\uCC45\uC774\uB77C\uB358\uAC00, \uACC4\uC57D\uC9C1\uC6D0\uC774\uB098 \uC2DC\uAC04\uAC15\uC0AC\uC758 \uAE09\uC5EC \uB4F1\uB4F1..",
