  "text" : "\uC774\uC5D0 \uBC95\uBB34\uBD80\uB294 \uB2E4\uC218 \uAD6D\uBBFC\uC758 \uC0DD\uBA85\uACFC \uC7AC\uC0B0\uC5D0 \uD53C\uD574\uB97C \uC785\uD788\uB294 \uBC94\uC8C4\uC5D0 \uB300\uD574 \uBC95\uC815 \uCD5C\uACE0\uD615(\uBB34\uAE30\uC9D5\uC5ED\u00B7\uC0AC\uD615)\uC774 \uC801\uC6A9\uB420 \uC218 \uC788\uB3C4\uB85D \uD558\uACE0, \uC5C5\uBB34\uC0C1 \uACFC\uC2E4\uCE58\uC0AC\uB97C \uC138\uBD84\uD654\uD574 \uC801\uC6A9\uD560 \uBC29\uCE68\uC774\uB2E4. \uB610 \uAE30\uC874 \uAD6D\uB0B4\uBC95\uC5D0\uB294 \uC801\uC6A9\uB418\uC9C0 \uC54A\uB294 \uACBD\uD569\uBC94\uC8C4\uC5D0 \uB300\uD55C \uD569\uC0B0\uC8FC\uC758 \uB3C4\uC785\uB3C4 \uAC80\uD1A0\uD574",
