  "text" : "\uC774\uB7EC\uD55C \uD53C\uD559\uB300\uC5EC\uC131\uB4E4\uC740 \uC6B0\uC6B8\uC99D\uC774\uB098 \uC678\uC0C1\uD6C4\uC2A4\uD2B8\uB808\uC2A4\uC7A5\uC560 \uB4F1\uC744 \uBCF4\uC774\uAC8C \uB418\uACE0, \uB098\uC911\uC5D0\uB294 \uC815\uC0C1\uC801\uC778 \uC0C1\uD669\uD310\uB2E8 \uBC0F \uD589\uB3D9\uC744 \uAE30\uB300\uD560 \uC218 \uC5C6\uC744 \uC815\uB3C4\uC758 \uC2EC\uC2E0\uC7A5\uC560\uB97C \uBCF4\uC774\uB294 \uACBD\uC6B0\uAC00 \uB9CE\uC544\uC694. \uADF8\uB7F0 \uC0C1\uD669\uC5D0\uC11C \uD53C\uD559\uB300\uC5EC\uC131\uB4E4\uC774 \uC678\uBD80\uC5D0 \uB3C4\uC6C0\uC744 \uC694\uCCAD\uD558\uAC70\uB098 \uC790\uB825\uD0C8\uCD9C\uD558\uAE30\uB97C \uAE30\uB300\uD558\uAE30\uB294 \uBB34\uB9AC\uC8E0.",
