  "text" : "\uADFC\uB370 \uD53C\uD559\uB300 \uB2F9\uC0AC\uC790\uB4E4\uC774 \uADF8\uAC78 \uBAB0\uB77C\uC11C \uC548\uD558\uB294\uAC8C \uC544\uB2D8\uC694.. \uC2E4\uC81C \uD559\uB300\uBC1B\uC740 \uC544\uB0B4\uB4E4\uC740 \uC815\uC2E0\uC801, \uC721\uCCB4\uC801 \uD559\uB300\uC640 \uD3ED\uB825\uC73C\uB85C \uC774\uBBF8 \uC2EC\uC2E0\uC774 \uBB34\uB108\uC838 \uC788\uB294 \uC0C1\uD0DC\uC774\uACE0, \uACB0\uBCC4\uC744 \uC2DC\uB3C4\uD558\uB2E4\uAC00 \uC624\uD788\uB824 \uC0AC\uD0DC\uAC00 \uC545\uD654\uB418\uAC70\uB098 \uCE5C\uC815\uC2DD\uAD6C \uB4F1\uC5D0 \uB300\uD55C \uD574\uC545\uC758 \uD611\uBC15 \uB4F1\uC73C\uB85C \uC778\uD574 \uC790\uD3EC\uC790\uAE30\uD55C \uC0C1\uD0DC.",
