  "text" : "\uB0A8\uD3B8\uC5D0\uAC8C \uD559\uB300\uBC1B\uB294 \uC5EC\uC131\uC5D0\uAC8C \"\uBC14\uBCF4\uC57C? \uC65C \uB2F9\uD558\uACE0\uB9CC \uC0B4\uC544? \uD5E4\uC5B4\uC9C0\uACE0 \uC2E0\uACE0\uB97C \uD558\uB358\uC9C0 \uD574\uC57C\uC9C0\" \uB77C\uB294 \uBC18\uC751\uB4E4\uC744 \uD754\uD788 \uBCFC \uC218 \uC788\uB294\uB370, \uC2EC\uC9C0\uC5B4\uB294 \uBC95\uC6D0\uC870\uCC28\uB3C4 '\uC65C \uB9DE\uACE0 \uC0B4\uC558\uB0D0. \uB2E4\uB978 \uBC29\uBC95\uB3C4 \uB9CE\uC558\uC796\uC544' \uB77C\uB294 \uB258\uC559\uC2A4\uB85C \uD53C\uD559\uB300\uC5EC\uC131\uC744 \uC9C8\uCC45\uD558\uBA70 \uC720\uC8C4\uB97C \uC120\uACE0\uD558\uB294 \uACBD\uC6B0\uB3C4 \uB9CE\uACE0",
