  "text" : "\uBC29\uC5B4\uD589\uC704\uB97C \uC704\uD55C \uAE30\uC900\uC744 \uD0C4\uB825\uC801\uC73C\uB85C \uD3C9\uAC00\uD558\uC790\uB294 \uAC83\uC774 \uC18C\uC704 \u201C\uB9E4\uB9DE\uB294 \uC5EC\uC131 \uC99D\uD6C4\uAD70\u201D\uC5D0 \uB300\uD55C \uB17C\uC758\uC758 \uC8FC\uC694\uB0B4\uC6A9\uC774\uB2E4.\n\n- \uC2E0\uB3D9\uC77C, '\uC815\uB2F9\uBC29\uC704\uAD8C \uC5ED\uC0AC\uC640 \uB3C4\uADF8\uB9C8\uD2F1: \uC911\uC138\uC801 \uCD9C\uBC1C\uC810\uACFC \uD604\uB300\uC801 \uC218\uC6A9', \uD615\uC0AC\uC815\uCC45\uC5F0\uAD6C, \uD55C\uAD6D\uD615\uC0AC\uC815\uCC45\uC5F0\uAD6C\uC6D0, 2013, \uC81C24\uAD8C \uC81C3\uD638",
