  "text" : "\uBCF4\uB2E4 \uBD84\uBA85\uD788 \uD30C\uC545\uD574\uC57C \uD558\uB294 \uAC83\uC740 \uC9C0\uC18D\uC801\uC778 \uD3ED\uB825\uC758 \uD53C\uD574\uC790\uC5D0\uAC8C \uD569\uB9AC\uC801\uC778 \uBC29\uC5B4\uD589\uC704\uB97C \uC694\uAD6C\uD558\uAE30 \uC5B4\uB835\uB2E4\uB294 \uC810\uC774\uB2E4. \uC9C0\uC18D\uC801 \uD3ED\uB825\uC5D0 \uB178\uCD9C\uB41C \uD53C\uD574\uC790\uB294 \uC790\uAE30\uBC29\uC5B4\uB97C \uD560 \uC218 \uC788\uB294 \uC815\uC2E0\uC801-\uC721\uCCB4\uC801 \uAC00\uB2A5\uC131\uB3C4 \uB0AE\uC544\uC9C4\uB2E4. \uC774\uB97C \uD574\uACB0\uD558\uB294 \uBC29\uBC95\uC73C\uB85C \uC6B0\uC120 \uC2E4\uC9C8\uC801 \uBC29\uC5B4\uC0C1\uD669\uC744 \uAC10\uC548\uD558\uC5EC",
