  "text" : "\uC77C\uC2DC\uC801\uC73C\uB85C \uBC1C\uC0DD\uD55C \uD3ED\uB825\uD589\uC704\uAC00 \uC911\uB2E8\uB418\uACE0 \uAC00\uD574\uC790\uC5D0 \uC758\uD574 \uD53C\uD574\uC790\uC5D0\uAC8C \uC6A9\uC11C\uAC00 \uAD6C\uAC78\uB418\uBA70, \uD3C9\uD654\uB85C\uC6B4 \uC2DC\uAE30\uAC00 \uC7A0\uC2DC \uC874\uC7AC\uD55C\uB2E4. \uADF8 \uD6C4 \uBE44\uC120\uD615\uC801\uC73C\uB85C \uD3ED\uB825\uC774 \uBC18\uBCF5\/\uC99D\uAC00\uB418\uB294 \uD328\uD134\uC744 \uAC00\uC9C4\uB2E4. \uC774\uC640 \uAC19\uC740 \uD328\uD134 \uB54C\uBB38\uC5D0, \uAC01 \uACF5\uACA9\uD589\uC704\uC758 \uC2DC\uC810\uC5D0\uC11C\uB9CC \uBC29\uC5B4\uD589\uC704\uB97C \uC694\uAD6C\uD558\uB294 \uAC83\uC740",
