  "text" : "\uACFC\uC789\uBC29\uC704\uC758 \uAC10\uBA74\uC0AC\uC720\uB97C \uAC80\uD1A0\uD560 \uC218 \uC788\uB294 \uC870\uAC74\uC73C\uB85C \uB420 \uAC83\uC774\uB2E4. \uB9E4\uB9DE\uB294 \uC5EC\uC131 \uC99D\uD6C4\uAD70\uC774 \uBD80\uB2F9\uD55C \uCE68\uD574\uB85C \uC778\uD574 \uBC1C\uC0DD\uD55C \uACBD\uC6B0 \uC815\uB2F9\uBC29\uC704\uC758 \uC77C\uBC18\uC801 \uAD6C\uC131\uC694\uAC74\uC744 \uC880 \uB354 \uD0C4\uB825\uC801\uC73C\uB85C \uAC80\uD1A0\uD574\uBCFC \uC218 \uC788\uB2E4. \uC774\uB7F0 \uC804\uC81C\uC5D0\uC11C \uD604\uC7AC\uC131\uC5D0 \uB300\uD55C \uC7AC\uD574\uC11D\uC740 \uAC00\uC7A5 \uC6B0\uC120\uC801\uC73C\uB85C \uC2DC\uB3C4\uD574\uBCFC \uC218 \uC788\uB2E4.",
