  "text" : "\uC2EC\uB9AC\uC801\uC73C\uB85C \uC774\uB7EC\uD55C \uC0C1\uD669\uC5D0 \uCC98\uD55C \uD53C\uD574\uC790\uB294 \uD569\uB9AC\uC801\uC778 \uACB0\uC815\uC744 \uBABB\uD55C\uB2E4. \uC989, \uB9E4\uB9DE\uB294 \uC5EC\uC131 \uC99D\uD6C4\uAD70\uACFC \uAC19\uC740 \uC870\uAC74\uC740 \uC815\uB2F9\uBC29\uC704\uC640 \uAD00\uB828\uD558\uC5EC \uC0C8\uB85C\uC6B4 \uB17C\uC7C1\uC810\uC744 \uAD6C\uC131\uD560 \uC218 \uC788\uB2E4. \uADF8 \uC99D\uD6C4\uAD70\uC774 \uBD80\uB2F9\uD55C \uACF5\uACA9\uACFC \uC778\uACFC\uC801\uC73C\uB85C \uC5F0\uAD00\uB418\uBA74 \uACE7\uBC14\uB85C \uC815\uB2F9\uBC29\uC704 \uB610\uB294 \uD615\uBC95 \uC81C21\uC870 \uC81C3\uD56D\uC758",
