  "text" : "\uACE0\uB3C4\uB85C \uACC4\uC0B0\uB41C \uBCF5\uC218\uC5D0 \uBD88\uACFC\uD560 \uC218 \uC788\uB2E4. \uB610\uD55C \uC9C0\uC18D\uC801\uC778 \uAC00\uC815\uD3ED\uB825\uACFC \uAC19\uC740 \uC0C1\uD669\uC5D0\uC11C\uB3C4 \uD3ED\uB825\uC744 \uBC29\uC5B4\uD558\uAE30 \uC704\uD558\uC5EC \uBC95\uC9C8\uC11C\uAC00 \uC694\uAD6C\uD558\uB294 \uC77C\uB828\uC758 \uD569\uB9AC\uC131 \uAE30\uC900\uC744 \uD589\uC704\uC790\uC5D0\uAC8C \uC694\uAD6C\uD558\uB294 \uAC83\uC740 \uBB34\uB9AC\uB2E4. \uADF8\uC5D0 \uD569\uB2F9\uD55C \uC870\uCE58\uB97C \uCDE8\uD560 \uC815\uB3C4\uC758 \uC0C1\uD669\uC774\uB77C\uBA74 \uC774\uBBF8 \uC815\uB2F9\uBC29\uC704 \uC694\uAC74\uC744 \uACB0\uC5EC\uD55C\uB2E4.",
