  "text" : "\uADF8\uB9AC\uACE0 \uBC29\uC5B4\uD589\uC704 \uC0C1\uD669\uC5D0\uC11C \uD589\uC704\uC790\uB294 \uD569\uB9AC\uC801\uC778 \uD310\uB2E8\uC744 \uD558\uAE30 \uC5B4\uB824\uC6B8 \uC218 \uC788\uB2E4\uB294 \uC810\uB3C4 \uACE0\uB824\uB418\uC5B4\uC57C \uD55C\uB2E4. \uB9CC\uC57D \uAE34\uAE09\uD55C \uC0C1\uD669\uC5D0\uC11C \uD589\uC704\uC790\uAC00 (\uBC95\uC9C8\uC11C\uAC00 \uC694\uAD6C\uD558\uB294 \uC815\uB3C4\uC758)\uD569\uB9AC\uC801\uC774\uACE0 \uC0AC\uD68C\uC724\uB9AC\uC801 \uAE30\uC900\uC5D0 \uB9DE\uB294 \uBC29\uC5B4\uD589\uC704\uB97C \uC120\uD0DD\uD560 \uC815\uB3C4\uB85C \uC774\uC131\uC801\uC774\uB77C\uBA74, \uC774 \uD589\uC704\uB294 \uBC29\uC5B4\uAC00 \uC544\uB2C8\uB77C",
