  "text" : "\uC778\uC2DD\uC774 \uAC15\uC870\uB41C \uACB0\uACFC\uB85C \uD310\uB2E8\uB41C\uB2E4. \uC989, \uD53C\uD559\uB300\uC5EC\uC131\uC774 \uC0AC\uC804 \uACB0\uBCC4\uC744 \uD1B5\uD574 \uC790\uC2E0\uC744 \uAD6C\uC81C\uD560 \uC218 \uC788\uC5C8\uC74C\uC5D0\uB3C4 \uD68C\uD53C\uD558\uC9C0 \uC54A\uACE0 \uAC00\uD574\uC790\uB97C \uC0B4\uD574\uD55C \uAC83\uC5D0 \uB300\uD55C \uC0B4\uC778\uC758 \uACE0\uC758\uC131\uC744 \uCD94\uC815\uD558\uACE0 \uC788\uB294 \uAC83\uC774\uB2E4. \uADF8\uB7EC\uB098 \uD53C\uD559\uB300\uC5EC\uC131\uC774 \uC0B4\uC778\uC758 \uAC00\uD574\uC790\uC778 \uB3D9\uC2DC\uC5D0 \uC7A5\uAE30\uD654 \uB41C \uAC00\uC815\uD3ED\uB825\uC758 \uD53C\uD574\uC790\uB77C\uB294",
