  "text" : "\uC2E4\uD328\uD558\uB294 \uACBD\uC6B0 \uACAA\uAC8C \uB418\uB294 \u2018\uACB0\uBCC4\uD3ED\uB825\u2019\uC744 \uACE0\uB824\uD558\uC5EC \uBCFC \uB54C, \uC801\uADF9\uC801\uC778 \uC801\uBC95\uC808\uCC28\uB97C \uD1B5\uD55C \uACB0\uBCC4\uC2DC\uB3C4\uAC00 \uC5B8\uC81C\uB098 \uAC00\uB2A5\uD55C \uAC83\uB9CC\uC774 \uC544\uB2C8\uB77C\uB294 \uC810\uC5D0 \uB300\uD55C \uACE0\uB824\uAC00 \uBBF8\uC9C4\uD55C \uAC83\uC73C\uB85C \uBCF4\uC778\uB2E4. \uB610\uD55C \uD68C\uD53C\uC758\uBB34\uC758 \uC694\uAD6C\uB294 \uD53C\uD559\uB300\uC5EC\uC131\uC774 \uAC00\uC815\uD3ED\uB825\uC758 \uD53C\uD574\uC790\uB77C\uB294 \uC778\uC2DD\uBCF4\uB2E4\uB294 \uC0B4\uC778\uC0AC\uAC74 \uAC00\uD574\uC790\uB77C\uB294",
