  "text" : "\uC2DC\uB3C4\uD588\uC5B4\uC57C \uD55C\uB2E4\uACE0 \uBCF8\uB2E4. \uB530\uB77C\uC11C \uC774\uC640 \uAC19\uC774 \uD569\uBC95\uC801 \uC808\uCC28\uB97C \uD1B5\uD558\uC5EC \uAC00\uC815\uD3ED\uB825\uC744 \uD53C\uD558\uB824\uB294 \uC2DC\uB3C4\uB3C4 \uD558\uC9C0 \uC54A\uACE0, \uD53C\uD574\uC790\uC758 \uC0DD\uBA85\uAD8C\uC744 \uCE68\uD574\uD558\uB294 \uAC83\uC5D0 \uB300\uD55C \uCC45\uC784\uC744 \uADFC\uAC70\uB85C \uC815\uB2F9\uBC29\uC704\uB97C \uC778\uC815\uD558\uC9C0 \uC544\uB2C8\uD55C\uB2E4.\n\n\uADF8\uB7EC\uB098 \uC2E4\uC81C\uB85C \uB9CE\uC740 \uD53C\uD559\uB300\uC5EC\uC131\uB4E4\uC774 \uAC00\uD574\uC790\uC640\uC758 \uACB0\uBCC4\uC744 \uC2DC\uB3C4\uD558\uB2E4",
