  "text" : "\uC815\uB2F9\uBC29\uC704 \uBCC0\uB860\uC5D0 \uB300\uD55C \uD310\uB2E8\uC5D0\uC11C \uB098\uD0C0\uB09C\uB2E4. \uC77C\uBD80 \uD310\uB840\uC5D0\uC11C\uB294 \uD53C\uD559\uB300\uC5EC\uC131\uB4E4\uC774 \uC815\uB2F9\uBC29\uC704 \uD589\uC0AC\uB97C \uD1B5\uD574 \uD53C\uD574\uC790\uC758 \uC0DD\uBA85\uC744 \uCE68\uD574\uD558\uAE30 \uC774\uC804\uC5D0, \uD53C\uD574\uC790\uC758 \uC9C0\uC18D\uC801\uC778 \uD3ED\uB825\uC73C\uB85C\uBD80\uD130 \uD569\uBC95\uC801\uC73C\uB85C \uD68C\uD53C\uD560 \uC218 \uC788\uB294 \uBC29\uBC95- \uC608\uB97C \uB4E4\uC5B4, \uAC00\uC815\uD3ED\uB825\uC0C1\uB2F4 \uBC0F \uC774\uD63C, \uC2E0\uACE0 \uB4F1 \uD569\uBC95\uC801\uC778 \uC808\uCC28\uB97C",
