  "text" : "\uC5B4\uB9AC\uC11D\uC740 \uC0AC\uB78C\uB3C4 \uC5F4\uD758 \uB9CC\uC5D0 \uBC30\uC6B8 \uC218 \uC788\uAC8C \uB41C\uB2E4. \uC774\uB85C\uC368 \uAE00\uC744 \uD574\uC11D\uD558\uBA74 \uADF8 \uB73B\uC744 \uC54C \uC218\uAC00 \uC788\uC73C\uBA70, \uC774\uB85C\uC368 \uC1A1\uC0AC\uB97C \uCCAD\uB2E8\uD558\uBA74 \uADF8 \uC2E4\uC815\uC744 \uC54C\uC544\uB0BC \uC218\uAC00 \uC788\uAC8C \uB41C\uB2E4.\u201D\uB77C\uACE0 \uD6C8\uBBFC\uC815\uC74C \uC11C\uBB38\uC5D0 \uC815\uC778\uC9C0\uAC00 \uC4F4 \uAE00\uC744 \uC885\uD569\uD558\uC5EC \uD6C8\uBBFC\uC815\uC74C \uCC3D\uC81C\uC758 \uC2E4\uC81C \uBAA9\uC801\uC744 \uC9D0\uC791\uD574\uBCFC \uBFD0\uC774\uB2E4.",
