  "text" : "\uB530\uB85C \uD070 \uC8C4\uC758 \uC870\uD56D\uB9CC\uC774\uB77C\uB3C4 \uBF51\uC544 \uC801\uACE0, \uC774\uB97C \uC774\uB450\uBB38\uC73C\uB85C \uBC88\uC5ED\uD558\uC5EC \uBBFC\uAC04\uC5D0\uAC8C \uBC18\uD3EC\uD558\uC5EC \uC6B0\uBD80\uC6B0\uBD80(\u611A\u592B\u611A\u5A66)\uB4E4\uB85C \uD558\uC5EC\uAE08 \uBC94\uC8C4\uB97C \uD53C\uD560 \uC904 \uC54C\uAC8C \uD558\uB294 \uAC83\uC774 \uC5B4\uB5BB\uACA0\uB294\uAC00?\u201D\uB77C\uB294 \uC138\uC885\uC758 \uB9D0\uACFC \u201C\uADF8\uB7F0 \uAE4C\uB2ED\uC73C\uB85C \uC9C0\uD61C\uB85C\uC6B4 \uC0AC\uB78C\uC740 \uC544\uCE68\uB098\uC808\uC774 \uB418\uAE30 \uC804\uC5D0 \uC774\uB97C \uC774\uD574\uD558\uACE0,",
