  "text" : "\uB2E8 \u201C\uC0AC\uB9AC\uB97C \uC798 \uC544\uB294 \uC0AC\uB78C\uC774\uB77C \uD560\uC9C0\uB77C\uB3C4, \uC728\uBB38\uC5D0 \uC758\uAC70\uD558\uC5EC \uD310\uB2E8\uC744 \uB0B4\uB9B0 \uB4A4\uC5D0\uC57C \uC8C4\uC758 \uACBD\uC911\uC744 \uC54C\uAC8C \uB418\uAC70\uB298, \uD558\uBB3C\uBA70 \uC5B4\uB9AC\uC11D\uC740 \uBC31\uC131\uC774\uC57C \uC5B4\uCC0C \uC790\uC2E0\uC774 \uC800\uC9C0\uB978 \uBC94\uC8C4\uAC00 \uD06C\uACE0 \uC791\uC74C\uC744 \uC54C\uC544\uC11C \uC2A4\uC2A4\uB85C \uACE0\uCE58\uACA0\uB294\uAC00. \uBE44\uB85D \uBC31\uC131\uB4E4\uB85C \uD558\uC5EC\uAE08 \uB2E4 \uC728\uBB38\uC744 \uC54C\uAC8C \uD560 \uC218\uB294 \uC5C6\uC744\uC9C0\uB098,",
