  "text" : "\uAD6C\uCCB4\uC801\uC778 \uCC3D\uC81C \uB3D9\uAE30\uAC00 \uBB34\uC5C7\uC778\uC9C0, \uC5B4\uB5A4 \uACFC\uC815\uC744 \uAC70\uCCD0 \uB9CC\uB4E4\uC5B4\uC84C\uB294\uC9C0 \uC804\uD558\uC9C0 \uC54A\uB294\uB2E4. \uC2EC\uC9C0\uC5B4 \uC138\uC885 \uB2E8\uB3C5 \uC791\uD488\uC778\uC9C0 \uC9D1\uD604\uC804 \uD559\uC790\uB4E4\uACFC\uC758 \uACF5\uB3D9 \uC791\uC5C5\uC778\uC9C0\uC5D0 \uB300\uD574\uC11C\uB3C4 \uB17C\uC7C1\uC774 \uACC4\uC18D\uB418\uACE0 \uC788\uB2E4. \uC5C4\uCCAD\uB09C \uBC18\uB300\uB97C \uC608\uC0C1\uD55C \uC138\uC885\uC774 \uBE44\uBC00\uB9AC\uC5D0 \uC791\uC5C5\uD55C \uC77C\uC774\uAE30\uC5D0 \uADF8\uB7F4 \uAC83\uC774\uB2E4.",
