  "text" : "\uAD00\uB300\uD558\uACE0 \uC740\uD61C\uB85C\uC6B4 \uC655\uC774\uC5C8\uB2E4. \uD6C8\uBBFC\uC815\uC74C \uCC3D\uC81C\uB3C4 \uC774\uB7EC\uD55C \uC560\uBBFC\uC815\uC2E0\uC5D0\uC11C \uBE44\uB86F\uB418\uC5C8\uB2E4. \uC0AC\uC2E4 \uD6C8\uBBFC\uC815\uC74C \uCC3D\uC81C\uC5D0 \uB300\uD574\uC11C\uB294 \uC804\uD558\uB294 \uAE30\uB85D\uC774 \uAC70\uC758 \uC5C6\uB2E4. \uC138\uC885 \uCD5C\uB300\uC758 \uC5C5\uC801\uC774\uBA74\uC11C \uC6B0\uB9AC \uC5ED\uC0AC\uC5D0\uC11C \uB9E4\uC6B0 \uC911\uC694\uD55C \uC0AC\uAC74\uC784\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC5B8\uC81C\uBD80\uD130 \uB9CC\uB4E4\uAE30 \uC2DC\uC791\uD588\uB294\uC9C0,",
