  "text" : "\uD5C8\uC704\uAC00 \uB420 \uC218\uB3C4 \uC788\uAE30 \uB54C\uBB38\uC774\uB2E4. \uADF8\uB7EC\uBBC0\uB85C \uD5C8\uC704\uC5EC\uBD80\uB294 \uACB0\uAD6D \uC5ED\uB3D9\uC801\uC778 \uD615\uC0AC\uC18C\uC1A1\uC808\uCC28\uB97C \uD1B5\uD574 \uBE44\uB85D \uC7A0\uC815\uC801\uC774\uB77C\uACE0 \uD558\uB354\uB77C\uB3C4 \uBE44\uB85C\uC18C \uBC1D\uD600\uC9C8 \uC218 \uC788\uB2E4. \uADF8\uB7EC\uB098 \uC774 \uACBD\uC6B0 \uC544\uB798\uC5D0\uC11C \uB17C\uC99D\uD558\uACA0\uC9C0\uB9CC, \uC785\uC99D\uC758 \uCC45\uC784\uC740 \uAC80\uC0AC\uC5D0\uAC8C \uC788\uC5B4\uC57C \uD560 \uAC83\uC774\uB2E4. \uB610\uD55C \uD5C8\uC704\uC758 \uB0B4\uC6A9\uC774\uB77C\uACE0 \uD558\uB354\uB77C\uB3C4",
