  "text" : "\uADF8\uB9AC\uACE0 \uD5C8\uC704\uC5D0 \uB300\uD55C \uBB38\uC81C\uB294 \uC808\uCC28\uBC95\uC801\uC778 \uC6D0\uCE59\uC5D0 \uC758\uD574 \uD574\uACB0\uD558\uB3C4\uB85D \uD558\uB294 \uAC83\uC774\uB2E4. \uC774\uB294 \uD5C8\uC704\uB77C\uB294 \uAC1C\uB150\uC774 \uACF5\uC775\uC774\uB780 \uAC1C\uB150\uCC98\uB7FC \uBAA8\uD638\uD558\uC9C0\uB294 \uC54A\uC9C0\uB9CC, \uC9C4\uC2E4\uACFC \uD5C8\uC704\uC758 \uAC1C\uB150\uC740 \uC7A0\uC815\uC801\uC774\uAE30 \uB54C\uBB38\uC5D0 \uD5C8\uC704\uB77C\uACE0 \uC0DD\uAC01 \uB418\uC5C8\uB358 \uAC83\uC774 \uD6C4\uC5D0 \uC9C4\uC2E4\uC774 \uB420 \uC218\uB3C4 \uC788\uACE0, \uC9C4\uC2E4\uC774\uB77C\uACE0 \uBBFF\uC5C8\uB358 \uAC83\uC774",
